class Tokeniser {
    static final char replacementChar = 'ï¿½';

    private org.jsoup.parser.CharacterReader reader;

    private boolean trackErrors = true;

    private java.util.List<org.jsoup.parser.ParseError> errors = new java.util.ArrayList<org.jsoup.parser.ParseError>();

    private org.jsoup.parser.TokeniserState state = TokeniserState.Data;

    private org.jsoup.parser.Token emitPending;

    private boolean isEmitPending = false;

    private java.lang.StringBuilder charBuffer = new java.lang.StringBuilder();

    java.lang.StringBuilder dataBuffer;

    Token.Tag tagPending;

    Token.Doctype doctypePending;

    Token.Comment commentPending;

    private Token.StartTag lastStartTag;

    private boolean selfClosingFlagAcknowledged = true;

    Tokeniser(org.jsoup.parser.CharacterReader reader) {
        this.reader = reader;
    }

    org.jsoup.parser.Token read() {
        if (!selfClosingFlagAcknowledged) {
            error("Self closing flag not acknowledged");
            selfClosingFlagAcknowledged = true;
        }
        while (!isEmitPending) {
            state.read(this, reader);
        } 
        if (charBuffer.length() > 0) {
            java.lang.String str = charBuffer.toString();
            charBuffer.delete(0, charBuffer.length());
            return new org.jsoup.parser.Token.Character(str);
        } else {
            isEmitPending = false;
            return emitPending;
        }
    }

    void emit(org.jsoup.parser.Token token) {
        org.jsoup.helper.Validate.isFalse(isEmitPending, "There is an unread token pending!");
        emitPending = token;
        isEmitPending = true;
        if (token.type == Token.TokenType.StartTag) {
            org.jsoup.parser.Token.StartTag startTag = ((org.jsoup.parser.Token.StartTag) (token));
            lastStartTag = startTag;
            if (startTag.selfClosing) {
                selfClosingFlagAcknowledged = false;
            }
        } else if (token.type == Token.TokenType.EndTag) {
            org.jsoup.parser.Token.EndTag endTag = ((org.jsoup.parser.Token.EndTag) (token));
            if (endTag.attributes.size() > 0) {
                error("Attributes incorrectly present on end tag");
            }
        }
    }

    void emit(java.lang.String str) {
        charBuffer.append(str);
    }

    void emit(char c) {
        charBuffer.append(c);
    }

    org.jsoup.parser.TokeniserState getState() {
        return state;
    }

    void transition(org.jsoup.parser.TokeniserState state) {
        this.state = state;
    }

    void advanceTransition(org.jsoup.parser.TokeniserState state) {
        reader.advance();
        this.state = state;
    }

    void acknowledgeSelfClosingFlag() {
        selfClosingFlagAcknowledged = true;
    }

    java.lang.Character consumeCharacterReference(java.lang.Character additionalAllowedCharacter, boolean inAttribute) {
        if (reader.isEmpty()) {
            return null;
        }
        if ((additionalAllowedCharacter != null) && (additionalAllowedCharacter == reader.current())) {
            return null;
        }
        if (reader.matchesAny('\t', '\n', '\f', '<', '&')) {
            return null;
        }
        reader.mark();
        if (reader.matchConsume("#")) {
            boolean isHexMode = reader.matchConsumeIgnoreCase("X");
            java.lang.String numRef = (isHexMode) ? reader.consumeHexSequence() : reader.consumeDigitSequence();
            if (numRef.length() == 0) {
                characterReferenceError();
                reader.rewindToMark();
                return null;
            }
            if (!reader.matchConsume(";")) {
                characterReferenceError();
            }
            int charval = -1;
            try {
                int base = (isHexMode) ? 16 : 10;
                charval = java.lang.Integer.valueOf(numRef, base);
            } catch (java.lang.NumberFormatException e) {
            }
            if (((charval == (-1)) || ((charval >= 0xd800) && (charval <= 0xdfff))) || (charval > 0x10ffff)) {
                characterReferenceError();
                return org.jsoup.parser.Tokeniser.replacementChar;
            } else {
                return ((char) (charval));
            }
        } else {
            java.lang.String nameRef = reader.consumeLetterSequence();
            boolean looksLegit = reader.matches(';');
            boolean found = false;
            while ((nameRef.length() > 0) && (!found)) {
                if (org.jsoup.nodes.Entities.isNamedEntity(nameRef)) {
                    found = true;
                } else {
                    nameRef = nameRef.substring(0, nameRef.length() - 1);
                    reader.unconsume();
                }
            } 
            if (!found) {
                if (looksLegit) {
                    characterReferenceError();
                }
                reader.rewindToMark();
                return null;
            }
            if (inAttribute && ((reader.matchesLetter() || reader.matchesDigit()) || reader.matches('='))) {
                reader.rewindToMark();
                return null;
            }
            if (!reader.matchConsume(";")) {
                characterReferenceError();
            }
            return org.jsoup.nodes.Entities.getCharacterByName(nameRef);
        }
    }

    Token.Tag createTagPending(boolean start) {
        tagPending = (start) ? new org.jsoup.parser.Token.StartTag() : new org.jsoup.parser.Token.EndTag();
        return tagPending;
    }

    void emitTagPending() {
        tagPending.finaliseTag();
        emit(tagPending);
    }

    void createCommentPending() {
        commentPending = new org.jsoup.parser.Token.Comment();
    }

    void emitCommentPending() {
        emit(commentPending);
    }

    void createDoctypePending() {
        doctypePending = new org.jsoup.parser.Token.Doctype();
    }

    void emitDoctypePending() {
        emit(doctypePending);
    }

    void createTempBuffer() {
        dataBuffer = new java.lang.StringBuilder();
    }

    boolean isAppropriateEndTagToken() {
        return tagPending.tagName.equals(lastStartTag.tagName);
    }

    java.lang.String appropriateEndTagName() {
        return lastStartTag.tagName;
    }

    boolean isTrackErrors() {
        return trackErrors;
    }

    void setTrackErrors(boolean trackErrors) {
        this.trackErrors = trackErrors;
    }

    void error(org.jsoup.parser.TokeniserState state) {
        if (trackErrors) {
            errors.add(new org.jsoup.parser.ParseError("Unexpected character in input", reader.current(), state, reader.pos()));
        }
    }

    void eofError(org.jsoup.parser.TokeniserState state) {
        if (trackErrors) {
            errors.add(new org.jsoup.parser.ParseError("Unexpectedly reached end of file (EOF)", state, reader.pos()));
        }
    }

    private void characterReferenceError() {
        if (trackErrors) {
            errors.add(new org.jsoup.parser.ParseError("Invalid character reference", reader.pos()));
        }
    }

    private void error(java.lang.String errorMsg) {
        if (trackErrors) {
            errors.add(new org.jsoup.parser.ParseError(errorMsg, reader.pos()));
        }
    }

    boolean currentNodeInHtmlNS() {
        return true;
    }
}
